actionConfiguration.body:
{{
JSON.stringify({
	variables: {
			warehouse:selectWarehouse.selectedOptionLabel
		},
    query: `
query QueryJobOrdersWarehouse($warehouse:String!) {
  queryJobOrder (filter: { dispatchStatus: { in: [CREATED,ACTIVE] } })@cascade{
    id
    name
    dispatchStatus
    operationsRequest{
			id
			equipment (filter: { name: { eq: $warehouse}}){
				id
			}
      operationsDefinition{
        material{
          code
        }
      }
		}
  }
}
    `
})
}}

